(310, 'blogger', 1, 23, 'a26a20467693a3b89580428c83f43737', 'd74ea67858a794673d31f2d273393f26', 'http://prosperent.com/store/product/xxxxxx-xxxx-x/?k=Crafting+Compelling+Stories+for+Emotional+Impact+-+DVD+Edition&m=Writers+Store&b=Writer%27s+Store&p=a26a20467693a3b89580428c83f43737&referrer=http%3A%2F%2Ftestdemoscript.blogspot.com%2F&location=http%3A%2F%2Ftestdemoscript.blogspot.com%2F&query=dvd', 'http://img1.prosperent.com/images/250x250/assets.writersstore.com/system/0000/1416/dvd13_large_medium.jpg', 'Crafting Compelling Stories for Emotional Impact - DVD Edition', '', 'Array', 'Without emotional involvement, a story is just a sequence of events, nothing more than words on the page, not the experience the reader craves. Going beyond what most seminars and screenwriting books offerrules, page templates, and plot formulasthis DVD goes right to the source: the work of highly successful screenwriters, showcasing powerful techniques for crafting compelling stories. Topics include: The five essential emotions in all successful stories. Grabbing the reader in the first page. Suspense vs. curiosity, emotional moments vs. conflict. The power of anticipation. Part of the Screenwriting Expo DVD Series, this 2-hour masters course is an exceptional value. Don''t miss this opportunity to learn from the finest faculty teaching screenwriting today.', 'DVDs', '14.95', '0.00', 'USD', 'Writers Store', 'Writer''s Store', '', '', '0', 'Waiting', 1400358035),
(311, 'blogger', 1, 23, 'd9df8db66464c333c1b3e79f7aa89a76', 'fc1bc95f0d3225fb3bb30f3de12dfa7f', 'http://prosperent.com/store/product/xxxxxx-xxxx-x/?k=The+Dialogue%3A+Learning+From+The+Masters+-+Bobby+and+Peter+Farrelly+-+DVD&m=Writers+Store&b=Writer%27s+Store&p=d9df8db66464c333c1b3e79f7aa89a76&referrer=http%3A%2F%2Ftestdemoscript.blogspot.com%2F&location=http%3A%2F%2Ftestdemoscript.blogspot.com%2F&query=dvd', 'http://img1.prosperent.com/images/250x250/assets.writersstore.com/system/0000/6067/the-dialogue-learning-from-the-masters-bobby-and-peter-farrelly_medium.jpg', 'The Dialogue: Learning From The Masters - Bobby and Peter Farrelly - DVD', '', 'Array', 'We don''t outline, we try to spend a lot of time on a good opening act where we try to create a character where just about anything could happen to this guy and the audience is with him, rooting for him. The writing/directing team of brothers Peter and Bobby Farrelly confirm the old adage that two heads are better than one. The filmmaking duo has reinvented the comedy with films like Dumb and Dumber, There''s Something About Mary, Me, Myself & Irene and Fever Pitch, and The Heartbreak Kid. While riddled with humor, primarily of the slapstick and gross-out varieties, there is still always the sweet love story beneath it all. In this interview, find out what the Farrelly Brothers think about test screenings, surprising the audience, painting themselves into a corner, and why sometimes it''s just not enough to make people laugh.', 'DVDs', '6.95', '0.00', 'USD', 'Writers Store', 'Writer''s Store', '', '', '0', 'Waiting', 1400951534),
