(363, 'blogger', 1, 24, '3a50ac8a0b8c207e3c99debf3f40859d', 'bddcc295058513979aff314ac6b0c0d2', 'http://prosperent.com/store/product/xxxxxx-xxxx-x/?k=Storywise+Workbook%3A+Story+Structure+for+the+TV+Spec+%26+Pilot+Script+-+E-Book&m=Writers+Store&b=Writer%27s+Store&p=3a50ac8a0b8c207e3c99debf3f40859d&referrer=http%3A%2F%2Ftestdemoscript.blogspot.com%2F&location=http%3A%2F%2Ftestdemoscript.blogspot.com%2F&query=book', 'http://img1.prosperent.com/images/250x250/assets.writersstore.com/system/0001/8050/storywise-workbook-story-structure-for-the-tv-spec-and-pilot-script_page_01_medium.jpg', 'Storywise Workbook: Story Structure for the TV Spec & Pilot Script - E-Book', '', 'Array', 'This workbook is Jen Grisanti''s most comprehensive one to date. It is 45 pages long and goes in depth into story structure for the TV spec and pilot script (both one hour and half hour) . It explores the foundation of a standout pilot and spec script. I provide formulas for ideal structure, pitch documents and bibles. Then, Jen breaks down what she believes are five of the strongest pilots that sold this season including three dramas and two half hours. She also alternatea between cable and network shows, so you get a strong sense of how to write for both. Additionally, she breaks down three of the strongest episodes of television from this past season. All of this is in an effort to show the writer how to do it right. With the tools provided in this workbook there is no limit to what you can achieve! Shows discussed in this workbook - THE C WORD, RIZZOLI & ISLES, UNDERCOVERS, FRIENDS WITH BENEFITS, DETROIT 1-8-7, THE GOOD WIFE, GLEE and MODERN FAMILY.', 'Books', '18.95', '0.00', 'USD', 'Writers Store', 'Writer''s Store', '', '', '0', 'Waiting', 1401268130),
